// Load superagent library as request
import * as request from "superagent";
import * as fs from 'fs';

// File > Export > Local API
// Define our Lobe HTTP server Url
const Url = 'http://localhost:38101/v1/predict/29bec370-6aa9-4f93-94af-2df35171cbeb';

// Define an input image serialized as base64
// On macOS: $ base64 /path/to/image.png | pbcopy
// which copies the base64 string to your clipboard
// const base64ImageOfBlackAndWhiteWatch = '';

// Read an input image and serialize as base64
// const imagePath = "/Users/nono/repos/Live/04/pix2pix-outputs/download-2.png";
const imagePath = "/Users/nono/Desktop/28/google-images-dataset/0188710b.jpg";
const imageAsBase64 = fs.readFileSync(imagePath, { encoding: "base64" });

// Define payload matching the JSON schema
// that shows up on the Local API Lobe menu
const payload = {
    "image": imageAsBase64
};

// Make a post request to our Local API server
// with the input image payload
request
    .post(Url)
    .set("accept", "json")
    .send(payload)
    .then(res => {
        // On success
        // Print output Label confidences
        console.log(res.body.predictions);
        // Print output Prediction
        // console.log(res.body.outputs.Prediction);
    })
    .catch(err => {
        // On error
        // Print error message
        console.log(err);
    });